import React from "react";
import { Icon } from "semantic-ui-react";

const Footer = () => (
  <footer>
    <a>
      <Icon>github</Icon>
    </a>
    <a>
      <Icon>linkedin square</Icon>
    </a>
    <a>
      <Icon>stack overflow</Icon>
    </a>
  </footer>
);
export default Footer;
